import React from "react";
import "./event_style.css";

function Createinfo() {
  return (
    <>
        <div className="create">
          <h4>이벤트를 생성하고 신청할 수 있는 페이지입니다.</h4>
          <h4>!!이벤트를 클릭해주세요!!</h4>
          <h4>이벤트 생성도 가능하답니다~</h4>
        </div>
    </>
  );
}

export default Createinfo;
